class LogIn extends Component{
  render(){
    return (
      <React.Fragment>
        <div class="split left">
          <div class="centered">
            <h1>Welcome !</h1>
            <h3>Already have an account ?</h3>
            <input
              type="text"
              id="user-name"
              class="input-box"
              placeholder="User Name"
            ></input>
