            id="user-pass"
            class="input-box"
            placeholder="Password"
          ></input>
          <br></br>
          <br></br>
          <button id="loginButton" onClick={checkAccount}>
            Log in!
          </button>
        </div>
      </div>

      <div class="split right">
        <div class="centered">
          <h1>Welcome !</h1>
          <h3>No Account? Sign up!</h3>
          <input
            type="text"
            id="newuser-name"
            class="input-box"
            placeholder="User Name"
          ></input>
          <br></br>
          <br></br>
          <input
            type="password"
            id="newuser-pass"
            class="input-box"
            placeholder="Password"
          ></input>
          <br></br>
          <br></br>
          <button id="signupButton" onClick={createAccount}>
            {" "}
            Sign Up
          </button>
        </div>
      </div>
    </React.Fragment>
  );
}
